import React from 'react';
import styled from "styled-components";

export const SiteTitle = styled.div`
padding: 20px 50px;
	font-size: 48px;
`
const MovieListHeading = (props) => {
	return (
		<div className='col'>
			<SiteTitle>{props.heading}</SiteTitle>
		</div>
	);
};

export default MovieListHeading;
